import React from 'react';
import './css/todo.css';


const Todo = (props) => {
  return (
    <div className='todo'>


        <h1>{props.description}</h1>
        <p>{props.done ? "done" : "not done" }</p>
        <button></button>
    </div>
  );
}


export default Todo;
